import { Dashboard } from "../AdminDashboard/admindashboard";
import './adminmasterapi.css'

const AdminMaster = () => {

    const master = () => {
        return (
            <>
                <div className="master">
                    <div className="">
                        <h3>Add location</h3>
                        <form className="form w-50 ">
                            <div className="row">
                                <input className="col form-control border-info" placeholder='Enter the location'></input>
                                <button className="col btn btn-info">Add</button>
                            </div>
                        </form>
                    </div>
                </div>
            </>
        )
    }

    return (
        <>
            <Dashboard />
            {master()}
        </>
    )
}

export default AdminMaster;
